import React from 'react';
import karnataka from "../images/karnataka.png";
function Home() {
  return (
    <div>
      <center>
      <h1>Welcome to Home</h1>
      <img src={karnataka} alt="Profile" style={{ maxWidth: "5%" }} />
      </ center>
    </div>
  );
}

export default Home;
